                  "name": "Edge Esmeralda x LabWeek Field Building",
                  "type": null,
                  "description": "<div>\n  A month-long pop-up village for people building the future in human organization, AI, crypto,\n  longevity, and hard tech. Below is a high level view of the themes that will be most\n  prominent each week -\n    <ul style=\"list-style: disc; font-size: 15px; line-height:24px; padding-left:15px; padding-block:27px;\">\n    <li><b>Week 1</b> | June 2 - 9 | Health, Climate, &amp; Hard Tech</li>\n    <li><b>Week 2</b> | June 10 - 16 | <span style=\"color:black;font-weight:700;\"><img style=\"width:16px; height:16px; display:inline-block; margin-right:4px; margin-bottom:2px;\" src=\"https://plabs-assets.s3.us-west-1.amazonaws.com/logo/labweek-logo.png\" alt='labweek'/>Lab</span><span style=\"color:#156FF7;font-weight:700;\">Week</span> <span style=\"color:black;\">FIELD BUILDING </span> Focusing on Neurotech,\n        BioTech, Mixed Reality, AI, &amp; Longevity</li>\n    <li><b>Week 3</b> | June 17 - 23 | New Governance, Institutions, Cities of Tomorrow,\n    Culture, &amp; Adventure Weekend</li>\n    <li><b>Week 4</b> | June 24 - 30 | Real-World Crypto, Cryptography Research, Zero\n    Knowledge, &amp; Protocols</li>\n    </ul>\n    Please note - adding your name here does NOT mean you are registered for the event.\n  </div>",
